$(document).ready((function(){const e=new XMLHttpRequest;e.open("GET","../json/structure.json"),e.responseType="text",e.send(),e.onload=function(){const s=document.querySelector("#hexGrid");let t="";JSON.parse(e.response).structure.forEach(e=>{t+=`<li class="hex"><div class="hexIn"><a class="hexLink" href="#"><div class="hexImageWrapper">${e.catImage}</div><h2 class="hexTitle">${e.catAlias}</h2></a></div></li>`}),s.insertAdjacentHTML("beforeend",t)}}));